import React from "react";
import "./contact.css";
export default function CONTACT() {
  return (
    <>
      <div className="container-fluid">
        <div className="row">
          <div className="col-sm-12">
            <div class="parallax3">
              <div>
                <h1 className="mt-5 mb-">Contact Me</h1>
                <form action="">
                    <input type="text" placeholder="Name" />
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
